const Contact = () => (
  <>
    <section className="contact">
      <div>
        <h1 className="title">Contact</h1>
        <p className="body">
          Have any questions? Let's talk! I am always open for new opportunities
          and friendships!
        </p>
      </div>
      <button className="btn">CALL TO ACTION</button>
    </section>
    <style jsx>
      {`
        .contact {
          display: block;
          margin: 100px 0px;
          padding-left: 15%;
        }
        .btn {
          font-size: 15px;
          padding: 10px;
          margin-top: 50px;
        }
      `}
    </style>
  </>
);

export default Contact;
